import React, { Component } from 'react'

export class Item extends Component {
    if(myArray){
        <div className="">LOakidn</div>
    }
  render() {
    return (
      <div>
        <ul>
        {this.props.myArray?.map((item) => (
          <li key={item}>{item + 10}</li>
        ))}
      </ul>
      </div>
    )
  }
}

export default Item
